var wide = false;
var sortedColumn = 0;
var valFunc = null;
var elm_highlight = null;
var XML_NAMESPACE = 'http://www.w3.org/1999/xhtml';

function init()
{
    addStretcher();
    addHeaderSort();
    addHighlight();
    addFilters();
}

Event.observe(window, 'load', init);

