function addStretcher()
{
    var stretcher = $('stretch');
    stretcher.addClassName('button');
    Event.observe(stretcher, 'click',  stretch.bind(stretcher) );
}

function addHeaderSort()
{
    var colHeaders = $$('thead th');
    colHeaders.each(
        function(th) {
            th.addClassName('button');
            Event.observe(th, 'mousedown',  function() { $("activitylabel").update("sorting..."); } );
            Event.observe(th, 'click',  sort.bindAsEventListener(th) );
        });
}

