/** QUICK SORT **/

function sort(e)
{
    var d = new Date();
    var start = d.getTime();

    Event.stop(e);
    var thead = this.up(1);
    var tbody = thead.next();
    var nRows = tbody.childNodes.length;
    var colNum = this.cellIndex;

    valFunc = getCellData;

	thead.select('th').each( function(th, index) {
	                            if(colNum == index) {
	                                th.style.fontStyle = 'italic';
	                            }
	                            else {
	                                th.style.fontStyle = 'normal';
	                            }
	});

	if(colNum == sortedColumn)
	{
		reverse(tbody, nRows);
	}
	else
	{
		sortedColumn = colNum;
		quickSortChildren(tbody);
	}

    tbody.select('tr').each( function(tr, index) {
        if(index % 2 == 1) {
            tr.addClassName('even');
        }
        else {
            tr.removeClassName('even');
        }
    });

    $("activitylabel").update();

    d = new Date();
}

function quickSortChildren(parent)
{
    var numberOfChildren = parent.childNodes.length;
    qsort(parent, 0, numberOfChildren);
}

function qsort(parent, begin, end)
{
	if((end - 1) > begin) {
		var pivot = begin + Math.floor(Math.random()*(end - begin));

		pivot=partition(parent, begin, end, pivot);

		qsort(parent, begin, pivot);
		qsort(parent, pivot+1, end);
	}
}

function partition(parent, begin, end, pivot)
{
	var piv = valFunc(parent.childNodes[pivot]);
	swap(parent, pivot, end-1);
	var store = begin;
	var ix;
	for(ix = begin; ix < (end-1); ++ix) {
		if(valFunc(parent.childNodes[ix]) <= piv) {
			swap(parent, store, ix);
			++store;
		}
	}
	swap(parent, end-1, store);

	return store;
}

function swap(parent, a, b)
{
	var element = parent.childNodes[a];
	var el = parent.childNodes[b];

	if (element == el) return;// element;

	var clone = el.cloneNode(false); // no need to clone deep
	Element.replace(element, clone);
	Element.replace(el, element);
	Element.replace(clone, el); // make sure references (like event observers) are kept
}

function getCellData(tr)
{
	var data = '';
	var td = tr.childNodes[sortedColumn];

	if(td != null && td.hasChildNodes()) {	// If the 'td' has childnodes...
		while(td.nodeType != 3  && td.hasChildNodes()) {	// 'Dig down' untill the textnode is found
			td = td.firstChild
		}
		data = td.nodeValue;
	}

    if(sortedColumn == 0) {
        return parseInt(data.toLowerCase());
    }
    else {
        return data.toLowerCase();
    }
}

/** END QUICK SORT **/

function stretch()
{
	var main = $("main");

	if(wide) {
		main.style.width = "760px";
		this.firstChild.nodeValue = '◄►';
		this.title = "Widen view";
	}
	else {
		main.style.width = "100%";
		this.firstChild.nodeValue = '►◄';
		this.title = "Narrow view";
	}

	wide = !wide;
}

function reverse(tbody, nRows)
{
	var c = null;
	for(var i = nRows-1; i >= 0; i--)
	{
        c = tbody.removeChild(tbody.childNodes[i]);
        tbody.appendChild(c);
    }
}

function highlight(elm_id)
{
    if (elm_highlight) {
        elm_highlight.removeClassName('elm_highlight');
    }

    elm_highlight = $(elm_id);
    elm_highlight.addClassName('elm_highlight');
}

/** FILTERING **/

var filterBackground = "data:image/png;base64,";

var QuickFilter = Class.create({
    filterform: '<div class="filterclearbutton" title="Clear field"></div><form><div><input type="text" class="searchfield" value=""/></div></form>',

    initialize: function(fieldContainer, elementsParent, elementsType, elementsName) {

        this.fieldContainer = $(fieldContainer);
        this.fieldContainer.style.backgroundImage = "url(" + filterBackground + ")";

        this.filteredElements = null;
        this.elementsCount = 0;
        this.elementsText = null;

        this.elementsParent = elementsParent;
        this.elementsType = elementsType;
        this.elementsName = elementsName;

        this._createIndex();

        this.fieldContainer.update(this.filterform);
        this.fieldContainer.show();
        this.field = this.fieldContainer.down('.searchfield');
        this.clearButton = this.fieldContainer.down('.filterclearbutton');
        this.clearButton.style.backgroundImage = "url(" + filterBackground + ")";

        Event.observe(this.field, 'keyup', this.filter.bindAsEventListener(this));
        Event.observe(this.clearButton, 'click', this._clear.bindAsEventListener(this));
    },

    _createIndex: function() {
        if(this.elementsType == 'tag') {
            this.filteredElements = $$('#' + this.elementsParent + ' ' + this.elementsName);
        }
        else if(this.elementsType == 'class') {
            this.filteredElements = $$('#' + this.elementsParent + ' .' + this.elementsName);
        }
        else {
            alert("Error! Unknown element type '" + this.elementsType + "' for QuickFilter!");
            return;
        }

        this.elementsCount = this.filteredElements.length;
        this.elementsText = new Array(this.elementsCount);

        if(this.elementsCount > 0) {
            for(i=0;i<this.elementsCount;i++) {
                this.elementsText[i] = this.filteredElements[i].innerHTML.gsub(/<[^>]+>/,' ').toLowerCase().unescapeHTML();
            }
        }
        else {
            alert("Error! No elements found!");
        }

    },

    filter: function() {
        var val = $F(this.field).strip().toLowerCase();

        if(val.length == 0) {
            this._clear();
            return;
        }

        val = val.split(' ')
        var len = val.length;

        if(val.length > 0) {
            for(i=0;i<this.elementsCount;i++) {
                this.filteredElements[i].style.display = '';
                for(j=0;j<len;j++) {
                    if(this.elementsText[i].indexOf(val[j]) == -1) {
                        this.filteredElements[i].style.display = 'none';
                    }
                }
            }
        }
    },

    _clear: function() {
    	for(i=0;i<this.elementsCount;i++) {
    		this.filteredElements[i].style.display = '';
    	}
    	this.field.clear();
    }
});


