// Crazy Easter Egg Stuff

var eggLayers = new Array();
var numberOfLayers = 0;
var eggMess = 1.0;
var eggOffs = 0;
var eggIndex = 0;
var eggRay = [Event.KEY_UP, Event.KEY_UP, Event.KEY_DOWN, Event.KEY_DOWN, Event.KEY_LEFT, Event.KEY_RIGHT, Event.KEY_LEFT, Event.KEY_RIGHT, 66, 65];
var frameCount = 760;
var viewY = 70;
var sineValues = new Array(frameCount);
var main = null;

function egg(e)
{
    if(eggLayers.size() > 0) {
        if(e.keyCode ==  Event.KEY_RIGHT) {
            eggMess++;
        }
        if(e.keyCode ==  Event.KEY_LEFT) {
            eggMess--;
        }
    }
    else {
        if(e.keyCode == eggRay[eggIndex]) {
            eggIndex++;
            if(eggIndex == 10) {
                initAnim();
            }
        }
        else {
            eggIndex = 0;
        }
    }
}

function initAnim()
{
    var logoHeader = $('logoheader');
    numberOfLayers = layerImages.size();
    main = $('main');

    for(i = 0; i < numberOfLayers; i++) {
        var elm = new Element('div', {'id': 'layer' + i, 'xmlns': XML_NAMESPACE});

        elm.style.height = viewY + "px";
        elm.style.backgroundImage = "url(" + layerImages[i].data + ")";
        elm.style.backgroundPosition = layerImages[i].xo + "px " + layerImages[i].yo + "px";
        if (!layerImages[i].loop) elm.style.backgroundRepeat = "no-repeat";
        if(i > 0) {
            elm.style.marginTop = "-" + viewY + "px";
        }
        eggLayers.push(elm);
        logoHeader.insert({'before': elm});
    }

    for(i = 0; i < frameCount; i++) {
        sineValues[i] = Math.sin(i / 13);
    }

    logoHeader.style.marginTop = "-70px";
    logoHeader.style.padding = "12px 5px 0 5px";
    logoHeader.down(2).hide();
    animate();
}

function animate()
{
    for(i = 0; i < numberOfLayers; i++) {
        eggLayers[i].style.backgroundPosition = ((eggOffs * layerImages[i].dx) + layerImages[i].xo) + 'px ' + ((eggOffs * layerImages[i].dy) + layerImages[i].yo) + 'px';
    }

    eggOffs = (eggOffs + eggMess) % frameCount;

    setTimeout(animate, 40);
}

Event.observe(document, 'keyup', egg)

